import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";

/* */

import App from "./App";
// import App from "./components/control.js";

const AppSwitch = () => (
  <BrowserRouter>
    <App />
  </BrowserRouter>
);

ReactDOM.render(<AppSwitch />, document.getElementById("root"));
